    "paid: the number of times your page's posts entered a person's screen through paid distribution such as an ad. unpaid : the number of times your page's posts entered a person's screen through unpaid distribution." => "แบบเสียเงิน: จำนวนครั้งที่โพสต์ของเพจคุณปรากฏบนหน้าจอของบุคคลผ่านการเผยแพร่แบบเสียเงิน เช่น โฆษณา แบบไม่เสียเงิน: จำนวนครั้งที่โพสต์ของเพจคุณปรากฏบนหน้าจอของบุคคลผ่านการเผยแพร่แบบไม่เสียเงิน",
    "page post impressions: paid vs unpaid" => "การแสดงผลโพสต์เพจ: แบบเสียเงิน vs แบบไม่เสียเงิน",
    "viral: the number of times your page's posts entered a person's screen with social information attached. social information displays when a person's friend interacted with you page or post. this includes when someone's friend likes or follows your page, engages with a post, shares a photo of your page and checks into your page. nonviral : the number of times your page's posts entered a person's screen. this does not include content created about your page with social information attached. social information displays when a person's friend interacted with you page or post. this includes when someone's friend likes or follows your page, engages with a post, shares a photo of your page and checks into your page." => "ไวรัล: จำนวนครั้งที่โพสต์ของเพจคุณปรากฏบนหน้าจอของบุคคลพร้อมข้อมูลโซเชียล ข้อมูลโซเชียลจะแสดงเมื่อเพื่อนของบุคคลโต้ตอบกับเพจหรือโพสต์ของคุณ ซึ่งรวมถึงเมื่อเพื่อนของใครบางคนถูกใจหรือติดตามเพจของคุณ มีส่วนร่วมกับโพสต์ แชร์รูปภาพเพจของคุณ และเช็คอินที่เพจของคุณ ไม่ใช่ไวรัล: จำนวนครั้งที่โพสต์ของเพจคุณปรากฏบนหน้าจอของบุคคล ซึ่งไม่รวมเนื้อหาที่สร้างขึ้นเกี่ยวกับเพจของคุณพร้อมข้อมูลโซเชียล ข้อมูลโซเชียลจะแสดงเมื่อเพื่อนของบุคคลโต้ตอบกับเพจหรือโพสต์ของคุณ ซึ่งรวมถึงเมื่อเพื่อนของใครบางคนถูกใจหรือติดตามเพจของคุณ มีส่วนร่วมกับโพสต์ แชร์รูปภาพเพจของคุณ และเช็คอินที่เพจของคุณ",
